import React from "react";
import { HeaderContainer, Menubar, OpacityContainer } from "../Header/style";

function Index() {
  return (
    <>
      <HeaderContainer>
        <OpacityContainer>wqeqwe</OpacityContainer>
        {/** Responsive by service have sreen from  900px to > 1200px*/}
        <Menubar />
      </HeaderContainer>
    </>
  );
}

export default Index;
